// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract GoTLandsNFT is ERC1155, Ownable {
  uint256 public constant WESTEROS = 0;
  uint256 public constant THE_NORTH = 1;
  uint256 public constant THE_VALE = 2;
  uint256 public constant THE_IRON_ISLANDS = 3;
  uint256 public constant THE_RIVERLANDS = 4;
  uint256 public constant THE_WESTERLANDS = 5;
  uint256 public constant THE_STORMLANDS = 6;
  uint256 public constant THE_REACH = 7;
  uint256 public constant KINGS_LANDING = 8;

  constructor() ERC1155("https://westeros.example/api/land/{id}.json") {
    _mint(msg.sender, WESTEROS, 1, ""); // Unique Token, Non-fungible Token (NFT), we only create 1 westeros
    _mint(msg.sender, THE_NORTH, 5000, ""); // Initial supply for The North
    _mint(msg.sender, THE_VALE, 20000, ""); // Initial supply for The Vale
    _mint(msg.sender, THE_IRON_ISLANDS, 50000, ""); // Initial supply for The Iron Islands
    _mint(msg.sender, THE_RIVERLANDS, 80000, ""); // Initial supply for The Riverlands
    _mint(msg.sender, THE_WESTERLANDS, 2000, ""); // Initial supply for The Westerlands
    _mint(msg.sender, THE_STORMLANDS, 30000, ""); // Initial supply for The Stormlands
    _mint(msg.sender, THE_REACH, 3000, ""); // Initial supply for The Reach
    _mint(msg.sender, KINGS_LANDING, 10, ""); // Initial supply for King's Landing (scarce)
  }

  function mint(
    address account,
    uint256 id,
    uint256 amount,
    bytes memory data
  ) public onlyOwner {
    _mint(account, id, amount, data);
  }

  function mintBatch(
    address to,
    uint256[] memory ids,
    uint256[] memory amounts,
    bytes memory data
  ) public onlyOwner {
    _mintBatch(to, ids, amounts, data);
  }

  function setURI(string memory newURI) external onlyOwner {
    _setURI(newURI);
  }
}

contracts/NFTMarketplace.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./SiliquaCoin.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract NFTMarketplace {
  using SafeERC20 for IERC20;

  address public owner;
  IERC20 public token;
  IERC721 public artNFT;
  IERC1155 public propertyNFT;
  address public nftAddress;

  mapping(uint256 => uint256) private nftPrices;

  constructor(address _tokenAddress, address _artNFT, address _propertyNFT) {
    token = SiliquaCoin(_tokenAddress);
    artNFT = IERC721(_artNFT);
    propertyNFT = IERC1155(_propertyNFT);
    nftAddress = address(this);
    owner = msg.sender;
  }

  modifier onlyOwner() {
    require(msg.sender == owner, "Only the owner can call this function");
    _;
  }

  function buyArtNFT(uint256 tokenId) external {
    token.safeTransferFrom(msg.sender, nftAddress, getPrice(tokenId));
    artNFT.safeTransferFrom(nftAddress, msg.sender, tokenId);
  }

  function buyPropertyNFT(uint256 tokenId, uint256 amount) external {
    token.safeTransferFrom(msg.sender, nftAddress, getPrice(tokenId) * amount);
    propertyNFT.safeTransferFrom(nftAddress, msg.sender, tokenId, amount, "");
  }

  function setPrice(uint256 tokenId, uint256 price) external onlyOwner {
    nftPrices[tokenId] = price;
  }

  function getPrice(uint256 tokenId) internal view returns (uint256) {
    return nftPrices[tokenId];
  }
}

